import { StyleSheet} from 'react-native';
const soldsComponentStyles = StyleSheet.create({
  div:{
    backgroundColor:'#DCF5FF',
    paddingHorizontal:10,
    paddingVertical:2,
    marginHorizontal:5,
    marginVertical:5,
    borderRadius:15,
    borderWidth:2,
    borderBottomColor:'#003247'
  },
  phonedata:{fontWeight: "bold"},
  soldstext:{
    fontSize:24,
    fontWeight:"bold",
    textAlign:"center",
    color:'#fff',
  },
  actualmonth:{
    textAlign:"center",
    marginBottom:10,
    color:'#fff',
    fontSize:20
  },
  data:{textAlign:"right"}
});
export {soldsComponentStyles};
